import ListOfExpenses from "./components/Expenses";

function App() {

  const expenses = [
    { title: "Car Insurance", amount: 54.22, date: new Date(2022, 0, 5) },
    { title: "Netflix", amount: 12.99, date: new Date(2022, 0, 9) },
    { title: "Gym", amount: 84, date: new Date(2022, 0, 7) },
    { title: "Toothpaste", amount: 5, date: new Date(2022, 0, 12) },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ListOfExpenses items={expenses} />
    </div>
  );
}

export default App;
